import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';

import { SharedModule } from 'app/shared/shared.module';
import {
  EmailTemplateComponent,
  EmailTemplateDetailComponent,
  EmailTemplateUpdateComponent,
  EmailTemplateDeleteDialogComponent,
  emailTemplateRoute,
} from './';

const ENTITY_STATES = [...emailTemplateRoute];

@NgModule({
  imports: [SharedModule, RouterModule.forChild(ENTITY_STATES)],
  declarations: [EmailTemplateComponent, EmailTemplateDetailComponent, EmailTemplateUpdateComponent, EmailTemplateDeleteDialogComponent],
  entryComponents: [EmailTemplateComponent, EmailTemplateUpdateComponent, EmailTemplateDeleteDialogComponent],
  providers: [],
  schemas: [CUSTOM_ELEMENTS_SCHEMA],
})
export class EmailTemplateModule {}
